import React, { useState } from "react";
import { Container, Row } from "react-bootstrap";
import Button from "react-bootstrap/Button";
import Form from "react-bootstrap/Form";
import Dropdown from "react-bootstrap/Dropdown";
import Card from "react-bootstrap/Card";
import Alert from "react-bootstrap/Alert";
// import { addOrganizationApi } from "../../services/api";

const InitialValues = {
  oType: "",
  oName: "",
  oAuthoName: "",
  oMobNo: "",
  oAddress: "",
  oCity: "",
  oEmail: "",
  oRegisNo: "",
  oUrl: "",
  oUserName: "",
  oPassword: "",
  oRePassword: "",
};

export default function OrganizationRegistration() {
  const [org, setOrg] = useState(InitialValues);
  const onValueChange2 = (e) => {
    console.log(e.target.name, e.target.innerText);
    setOrg({ ...org, [e.target.name]: e.target.innerText });
    console.log(org);
  };
  const onValueChange = (e) => {
    console.log(e.target.name, e.target.value);
    setOrg({ ...org, [e.target.name]: e.target.value });
    console.log(org);
  };
  const addOrganization = async () => {
    // await addOrganizationApi(org);
  };
  const styles = {
    cardstyle: {
      width: "45rem",
      marginBottom: "20rem",
    },
  };
  return (
    <div className="d-flex justify-content-center">
      <div className="pt-5 pb-5 ">
        <Card style={styles.cardstyle}>
          <Alert variant="secondary">
            <Alert.Heading className="d-flex justify-content-center">
              Or
            </Alert.Heading>
          </Alert>
          <Form>
            <Form.Group as={Row} className="mb-3" controlId="formBasicEmail">
              <Form.Label column sm={2}>
                Type of Organization
              </Form.Label>

              <Dropdown column sm={2}>
                <Dropdown.Toggle variant="success" id="dropdown-basic">
                  Select type of Organization
                </Dropdown.Toggle>

                <Dropdown.Menu>
                  <Dropdown.Item
                    id="ngo"
                    onClick={(e) => {
                      onValueChange2(e);
                    }}
                    name="oType"
                  >
                    ngo
                  </Dropdown.Item>
                  <Dropdown.Item
                    id="non-ngo"
                    onClick={(e) => {
                      onValueChange2(e);
                    }}
                    name="oType"
                  >
                    non-ngo
                  </Dropdown.Item>
                </Dropdown.Menu>
              </Dropdown>
            </Form.Group>
            <Form.Group as={Row} className="mb-3" controlId="formBasicEmail">
              <Form.Label column sm={2}>
                Name Organization
              </Form.Label>

              <Form.Control
                type="text"
                placeholder="Enter Name Organization"
                style={{ width: "25%" }}
                onChange={(e) => onValueChange(e)}
                name="oName"
              />
            </Form.Group>
            <Form.Group as={Row} className="mb-3" controlId="formBasicEmail">
              <Form.Label column sm={2}>
                Name of Authority
              </Form.Label>

              <Form.Control
                type="text"
                placeholder="Enter name authority"
                style={{ width: "25%" }}
                onChange={(e) => onValueChange(e)}
                name="oAuthoName"
              />
            </Form.Group>
            <Form.Group as={Row} className="mb-3" controlId="formBasicEmail">
              <Form.Label column sm={2}>
                Mobile No
              </Form.Label>

              <Form.Control
                type="number"
                placeholder="Enter your mobile no"
                style={{ width: "25%" }}
                onChange={(e) => onValueChange(e)}
                name="oMobNo"
              />
            </Form.Group>
            <Form.Group as={Row} className="mb-3" controlId="formBasicEmail">
              <Form.Label column sm={2}>
                Address
              </Form.Label>

              <Form.Control
                type="text"
                placeholder="Enter Organization address"
                style={{ width: "25%" }}
                onChange={(e) => onValueChange(e)}
                name="oAddress"
              />
            </Form.Group>
            <Form.Group as={Row} className="mb-3" controlId="formBasicEmail">
              <Form.Label column sm={2}>
                City
              </Form.Label>

              <Form.Control
                type="text"
                placeholder="Enter Organization city"
                style={{ width: "25%" }}
                onChange={(e) => onValueChange(e)}
                name="oCity"
              />
            </Form.Group>
            <Form.Group as={Row} className="mb-3" controlId="formBasicEmail">
              <Form.Label column sm={2}>
                Email Address
              </Form.Label>

              <Form.Control
                type="email"
                placeholder="Enter your email address here"
                style={{ width: "25%" }}
                onChange={(e) => onValueChange(e)}
                name="oEmail"
              />
            </Form.Group>
            <Form.Group as={Row} className="mb-3" controlId="formBasicEmail">
              <Form.Label column sm={2}>
                Registration Number
              </Form.Label>

              <Form.Control
                type="text"
                placeholder="Enter Organization RGSNO"
                style={{ width: "25%" }}
                onChange={(e) => onValueChange(e)}
                name="oRegisNo"
              />
            </Form.Group>
            <Form.Group as={Row} className="mb-3" controlId="formBasicEmail">
              <Form.Label column sm={2}>
                URL of Organization
              </Form.Label>

              <Form.Control
                type="url"
                placeholder="Enter Organization address"
                style={{ width: "25%" }}
                onChange={(e) => onValueChange(e)}
                name="oUrl"
              />
            </Form.Group>
            <Form.Group as={Row} className="mb-3" controlId="formBasicEmail">
              <Form.Label column sm={2}>
                User Name
              </Form.Label>

              <Form.Control
                type="text"
                placeholder="Enter User Name"
                aria-label="Username"
                style={{ width: "25%" }}
                onChange={(e) => onValueChange(e)}
                name="oUserName"
              />
            </Form.Group>
            <Form.Group as={Row} className="mb-3" controlId="formBasicEmail">
              <Form.Label column sm={2}>
                Password
              </Form.Label>

              <Form.Control
                type="password"
                placeholder="enter password"
                style={{ width: "25%" }}
                onChange={(e) => onValueChange(e)}
                name="oPassword"
              />
            </Form.Group>
            <Form.Group as={Row} className="mb-3" controlId="formBasicEmail">
              <Form.Label column sm={2}>
                Re-Enter Password
              </Form.Label>

              <Form.Control
                type="password"
                placeholder="re-enter password"
                style={{ width: "25%" }}
                onChange={(e) => onValueChange(e)}
                name="oRePassword"
              />
            </Form.Group>

            <Form.Group className="mb-3" controlId="formBasicCheckbox">
              <Form.Check type="checkbox" label="Accept Terms & Check me out" />
            </Form.Group>
            <Button
              onClick={() => addOrganization()}
              variant="outline-success"
              type="submit"
            >
              Register As Organization..
            </Button>
            <Button variant="outline-success" type="reset">
              Reset Values
            </Button>
          </Form>
        </Card>
      </div>
    </div>
  );
}
